var Main={init:function(){this.$window=$(window),this.sidebarNav(),this.handleWindowScroll(),this.handleWindowResize(),this.carouselSlider()},navShrink:function(){var i=$(".navbar-fixed-top");this.$window.scrollTop()>60?i.addClass("shrink"):i.removeClass("shrink")},sidebarNav:function(){var i=$("[data-toggle=collapse-side]"),n=i.attr("data-target"),a=i.attr("data-target-2");i.click(function(i){$(n).toggleClass("in"),$(a).toggleClass("out")})},handleWindowResize:function(){var i=this;this.$window.on("resize",function(){i.$window.width()<=768&&$(".navbar-fixed-top").removeClass("shrink")})},handleWindowScroll:function(){var i=this;this.$window.on("scroll",function(){i.$window.width()>=768&&i.navShrink()})},carouselSlider:function(){$(".carousel").carousel()}};!function(){Main.init()}();